 object \n    task.spawn(function()\n        local objs = workspace:GetDescendants()\n        for i = 1, #objs do\n            simplifyObject(objs[i])\n            if i % 100 == 0 then\n                task.wait() -- ng\u1eaft frame \u0111\u1ec3 kh\u00f4ng treo game\n            end\n        end\n    end)\n\n    -- \u0110\u01a1n gi\u1ea3n ho\u00e1 object m\u1edbi spawn sau\n    addedConnection = workspace.DescendantAdded:Connect(function(obj)\n        if lowpolyEnabled then\n            task.defer(function()\n                simplifyObject(obj)\n            end)\n        end\n    end)\nend\n\n-- ===== Restore Graphics =====\nlocal function restoreGraphics()\n    lowpolyEnabled = false\n    if addedConnection then\n        addedConnection:Disconnect()\n        addedConnection = nil\n    end\n    if setfpscap then setfpscap(360) end\nend\n\n-- ===== Public API =====\nfunction M.setPotatoMode(state: boolean)\n    if state then\n        applyLowpoly()\n        if setfpscap then setfpscap(30) end\n    else\n        restoreGraphics()\n    end\nend\n\nreturn M\n","hairdresser":"-- This file was protected using Luraph Obfuscator v14.5.1 [https://lura.ph/]\n\nreturn({op=function(r,B,R,p)for G=0X1,B[0B11111]()do G=nil;local g;for e=0x6B,245,69 do if e==0Xb0 then p,g=r:Mp(R,g,G,p,B);else if e==0B1101011 then G=r:np(B,G);else if e==0xf5 then p+=0B1;end;end;end;end;end;return p;end,yp=function(r,B,R,p)for G=0X1,R do local R=p[0X22]();if not(p[0X27][R])then r:Ep(G,B,p,R);else B[G]=p[0x27][R];end;end;end,qp=function(r,r,B,R,p)(R)[r]=p[0X17][B];end,np=function(r,r,B)B=r[0X1F]();return B;end,Ip=function(r,B,R,p,G,g,e,a,C,t,D)local E;B=(0X31__);repeat B,e,R,D,E,g,p=r:vp(R,p,B,C,D,e,g);if E==0x15Dc then break;else if E==33329 then continue;end;end;until false;G=(nil);a=nil;t=(nil);return B,e,t,R,a,D,g,G,p;end,N0=function(r,B,R,p,G,g,e,a,C,t)local D;C[6][0XD]=r.m;B=0x7E;repeat if B>0B100__010_1 then if B<=0x60 then C[0X6][0XC]=r.T;break;else B=r:m0(B,G,C);end;else B=r:c0(B,G,C);continu